import { Component, Inject } from '@angular/core';
import { MatDialogRef, MAT_DIALOG_DATA } from '@angular/material/dialog';
import { Unsubscribe } from 'redux';
import CartModel from 'src/app/models/cart.model';
import ItemModel from 'src/app/models/item.model';
import UserModel from 'src/app/models/user.model';
import store from 'src/app/redux/store';
import { CartsService } from 'src/app/services/carts.service';
import { NotifyService } from 'src/app/services/notify.service';
import { OrdersService } from 'src/app/services/orders.service';
import OrderModel from 'src/app/models/order.model';

export interface DialogData {
}

@Component({
  selector: 'app-dialog',
  templateUrl: './dialog.component.html',
  styleUrls: ['./dialog.component.css']
})
export class DialogComponent {

  public items: ItemModel[];
  private unsubscribeMe: Unsubscribe;
  private carts: CartModel[];
  public order: OrderModel;
  public orders: OrderModel[];
  public user: UserModel;
  private lastCartIndex: number;
  private lastOrderIndex: number;

  constructor(
    private myCartsService: CartsService,
    private myOrdersService: OrdersService,
    private notify: NotifyService,

    public dialogRef: MatDialogRef<DialogComponent>,
    @Inject(MAT_DIALOG_DATA) public data: DialogData,
  ) {}

  ngOnInit() {
    this.unsubscribeMe = store.subscribe(async () => {
      this.user = store.getState().authState.user;
      try {
        this.carts = await this.myCartsService.getAllCarts(this.user._id);
      }
      catch (err) {
          console.log("err getting user carts");
      }
      this.lastCartIndex = this.carts.length - 1;
    });
  }

  ngOnDestroy(): void {
      this.unsubscribeMe();
  }

  onNoClick(): void {
    this.dialogRef.close();
  }

  async getYourReceipt() {
    // console.log(this.user._id + "can remove");
    this.user = store.getState().authState.user;
    try {
      this.orders = await this.myOrdersService.getAllUserOrders(this.user._id);
    }
    catch (err) {
        console.log("err getting user carts");
    }
    this.lastOrderIndex = this.orders.length - 1;
    console.log(this.orders[this.lastOrderIndex]._id);
    try {
      const receipt = await this.myOrdersService.getReceipt(this.orders[this.lastOrderIndex]._id);
      console.log(receipt);
    }
    catch (err) {
        console.log("err getting user orders");
    }
  }
}
<div class="main">
    <div mat-dialog-content>
        <div >
            <h3>Your order was completed</h3>
        </div>
    </div>
    <div mat-dialog-actions>
        <button mat-stroked-button download="file.txt">Click here to get your receipt</button>
        <br/>
        <a mat-stroked-button routerLink="/home" routerLinkActive="active">Finish</a>
    </div>
</div>
